import React from 'react';


function SignupForm(){
    return (
        <form>
            <lable>
                Name: <input type="text" name="name" />
            </lable>
            <br/>
            <label>
                Email: <input type="email" name="email"/>
            </label>
            <br/>
            <input type="submit" value="Submit"></input>
        </form>
    )
}
